How create a backend service and connect to it over JSON-RPC
In this section I will explain how you can create a backend service and
then connect to it over JSON-RPC.
I will use the debug logging system as a small example of that.
Overview
This works by creating a service exposed by the express framework and
then connecting to that over a websocket connection.
Registering a service
So the first thing you will want to do is expose your service so that the
frontend can connect to it.
You will need to create backend server module file similar to this (logger-server-module.ts):

import { ContainerModule } from 'inversify';
import { ConnectionHandler, JsonRpcConnectionHandler } from "../../messaging/common";
import { ILoggerServer, ILoggerClient } from '../../application/common/logger-protocol';

export const loggerServerModule = new ContainerModule(bind => {
    bind(ConnectionHandler).toDynamicValue(ctx =>
        new JsonRpcConnectionHandler("/services/logger", client => {
            const loggerServer = ctx.container.get(ILoggerServer);
            loggerServer.setClient(client);
            return loggerServer;
        })
    ).inSingletonScope()
});

Let's go over that in detail:
import { ConnectionHandler, JsonRpcConnectionHandler } from "../../messaging/common";

This imports the JsonRpcConnectionHandler, this factory enables you to create
a connection handler that onConnection creates proxy object to the object that
is called in the backend over JSON-RPC and expose a local object to JSON-RPC.
We'll see more on how this is done as we go.
The ConnectionHandler is a simple interface that specifies the path of the
connection and what happens on connection creation.
It looks like this:
import { MessageConnection } from "vscode-jsonrpc";

export const ConnectionHandler = Symbol('ConnectionHandler');

export interface ConnectionHandler {
    readonly path: string;
    onConnection(connection: MessageConnection): void;
}

import { ILoggerServer, ILoggerClient } from '../../application/common/logger-protocol';

The logger-protocol.ts file contains the interfaces that the server and the
client need to implement.
The server here means the backend object that will be called over JSON-RPC
and the client is a client object that can receive notifications from the
backend object.
I'll get more into that later.
    bind(ConnectionHandler).toDynamicValue(ctx => {

Here a bit of magic happens, at first glance we're just saying here's an
implementation of a ConnectionHandler.
The magic here is that this ConnectionHandler type is bound to a
ContributionProvider in messaging-module.ts
So as the MessagingContribution starts (onStart is called) it creates a
websocket connection for all bound ConnectionHandlers.
like so (from messaging-module.ts):
constructor( @inject(ContributionProvider) @named(ConnectionHandler) protected readonly handlers: ContributionProvider) {
    }

    onStart(server: http.Server): void {
        for (const handler of this.handlers.getContributions()) {
            const path = handler.path;
            try {
                createServerWebSocketConnection({
                    server,
                    path
                }, connection => handler.onConnection(connection));
            } catch (error) {
                console.error(error)
            }
        }
    }

To dig more into ContributionProvider see this section.
So now:
new JsonRpcConnectionHandler("/services/logger", client => {

This does a few things if we look at this class implementation:
export class JsonRpcConnectionHandler implements ConnectionHandler {
    constructor(
        readonly path: string,
        readonly targetFactory: (proxy: JsonRpcProxy) => any
    ) { }

    onConnection(connection: MessageConnection): void {
        const factory = new JsonRpcProxyFactory(this.path);
        const proxy = factory.createProxy();
        factory.target = this.targetFactory(proxy);
        factory.listen(connection);
    }
}

We see that a websocket connection is created on path: "logger" by the extension of the ConnectionHandler class with the path attribute set to "logger".
And let's look at what it does onConnection : 
    onConnection(connection: MessageConnection): void {
        const factory = new JsonRpcProxyFactory(this.path);
        const proxy = factory.createProxy();
        factory.target = this.targetFactory(proxy);
        factory.listen(connection);

Let's go over this line by line:
    const factory = new JsonRpcProxyFactory(this.path);

This creates a JsonRpcProxy on path "logger".
    const proxy = factory.createProxy();

Here we create a proxy object from the factory, this will be used to call
the other end of the JSON-RPC connection using the ILoggerClient interface.
    factory.target = this.targetFactory(proxy);

This will call the function we've passed in parameter so:
        client => { 
            const loggerServer = ctx.container.get(ILoggerServer);
            loggerServer.setClient(client);
            return loggerServer;
        }

This sets the client on the loggerServer, in this case this is used to
send notifications to the frontend about a log level change.
And it returns the loggerServer as the object that will be exposed over JSON-RPC.
 factory.listen(connection);

This connects the factory to the connection.
The endpoints with services/* path are served by the webpack dev server, see webpack.config.js:
    '/services/*': {
        target: 'ws://localhost:3000',
        ws: true
    },

Connecting to a service
So now that we have a backend service let's see how to connect to it from
the frontend.
To do that you will need something like this:
(From logger-frontend-module.ts)
import { ContainerModule, Container } from 'inversify';
import { WebSocketConnectionProvider } from '../../messaging/browser/connection';
import { ILogger, LoggerFactory, LoggerOptions, Logger } from '../common/logger';
import { ILoggerServer } from '../common/logger-protocol';
import { LoggerWatcher } from '../common/logger-watcher';

export const loggerFrontendModule = new ContainerModule(bind => {
    bind(ILogger).to(Logger).inSingletonScope();
    bind(LoggerWatcher).toSelf().inSingletonScope();
    bind(ILoggerServer).toDynamicValue(ctx => {
        const loggerWatcher = ctx.container.get(LoggerWatcher);
        const connection = ctx.container.get(WebSocketConnectionProvider);
        return connection.createProxy("/services/logger", loggerWatcher.getLoggerClient());
    }).inSingletonScope();
});

The important bit here are those lines: 
    bind(ILoggerServer).toDynamicValue(ctx => {
        const loggerWatcher = ctx.container.get(LoggerWatcher);
        const connection = ctx.container.get(WebSocketConnectionProvider);
        return connection.createProxy("/services/logger", loggerWatcher.getLoggerClient());
    }).inSingletonScope();

Let's go line by line:
        const loggerWatcher = ctx.container.get(LoggerWatcher);

Here we're creating a watcher, this is used to get notified about events
from the backend by using the loggerWatcher client
(loggerWatcher.getLoggerClient())
See more information about how events work in theia here.
        const connection = ctx.container.get(WebSocketConnectionProvider);

Here we're getting the websocket connection, this will be used to create a proxy from.
        return connection.createProxy("/services/logger", loggerWatcher.getLoggerClient());

As the second argument, we pass a local object to handle JSON-RPC messages from the remote object.
Sometimes the local object depends on the proxy and cannot be instantiated before the proxy is instantiated.
In such cases, the proxy interface should implement JsonRpcServer and the local object should be provided as a client.
export type JsonRpcServer = Disposable & {
    setClient(client: Client | undefined): void;
};

export interface ILoggerServer extends JsonRpcServery {
    // ...
}

const serverProxy = connection.createProxy("/services/logger");
const client = loggerWatcher.getLoggerClient();
serverProxy.setClient(client);

So here at the last line we're binding the ILoggerServer interface to a
JsonRpc proxy.
Note that his under the hood calls:
 createProxy(path: string, target?: object, options?: WebSocketOptions): T {
        const factory = new JsonRpcProxyFactory(path, target);
        this.listen(factory, options);
        return factory.createProxy();
    }

So it's very similar to the backend example.
Maybe you've noticed too but as far as the connection is concerned the frontend
is the server and the backend is the client. But that doesn't really
matter in our logic.
So again there's multiple things going on here what this does is that:

it creates a JsonRpc Proxy on path "logger".
it exposes the loggerWatcher.getLoggerClient() object.
it returns a proxy of type ILoggerServer.

So now instances of ILoggerServer are proxied over JSON-RPC to the
backend's LoggerServer object.
Loading the modules in the example backend and frontend
So now that we have these modules we need to wire them into the example.
We will use the browser example for this, note that it's the same code for
the electron example.
Backend
In examples/browser/src/backend/main.ts you will need something like:
import { loggerServerModule } from 'theia-core/lib/application/node/logger-server-module';

And than load that into the main container:
container.load(loggerServerModule);

Frontend
In examples/browser/src/frontend/main.ts you will need something like:
import { loggerFrontendModule } from 'theia-core/lib/application/browser/logger-frontend-module';

container.load(frontendLanguagesModule);

Complete example
If you wish to see the complete implementation of what I referred too in
this documentation see this commit.
Contribution Providers
A contribution provider is basically a container for contributions where
contributions are instances of a bound type.
It is very generic.
To bind a type to a contribution provider you can do like this:
(From messaging-module.ts)
export const messagingModule = new ContainerModule(bind => {
    bind(BackendApplicationContribution).to(MessagingContribution);
    bindContributionProvider(bind, ConnectionHandler)
});

The last line will bind a ContributionProvider to one that contains all
ConnectionHandler bound instances.
It is used as such:
(From messaging-module.ts)
    constructor( @inject(ContributionProvider) @named(ConnectionHandler) protected readonly handlers: ContributionProvider) {
    }

So here we're injecting a ContributionProvider with the named
ConnectionHandler value that was bound before by bindContributionProvider.
This enables anyone to bind a ConnectionHandler and now when the
messagingModule is started all the ConnectionHandlers will be initiated.
Events
Events in Theia can be confusing, hopefully we can clarify things.
Let's consider this code:
(From logger-watcher.ts)
@injectable()
export class LoggerWatcher {

    getLoggerClient(): ILoggerClient {
        const emitter = this.onLogLevelChangedEmitter
        return {
            onLogLevelChanged(event: ILogLevelChangedEvent) {
                emitter.fire(event)
            }
        }
    }

    private onLogLevelChangedEmitter = new Emitter();

    get onLogLevelChanged(): Event {
        return this.onLogLevelChangedEmitter.event;
    }
}

Let's start with:
    private onLogLevelChangedEmitter = new Emitter();

So first what is an Emitter?
An Emitter is an event handler container,
it allows for event handlers to be registered on it and triggered with an
event of type X in this case an ILogLevelChangedEvent.
So here we just create an Emitter that will have events of type ILogLevelChangedEvent;
Next we want to be able to register an event handler on this Emitter to
do so we do this:
    get onLogLevelChanged(): Event {
        return this.onLogLevelChangedEmitter.event;
    }

What this actually returns is a function that will register an event
handler so you just pass it your event handler function and it will
register it so that it's called when the event fires.
so you can call:
(From logger.ts)
 /* Update the root logger log level if it changes in the backend. */
        loggerWatcher.onLogLevelChanged(event => {
            this.id.then(id => {
                if (id === this.rootLoggerId) {
                    this._logLevel = Promise.resolve(event.newLogLevel);
                }
            });
        });

This registers the anonymous function passed as param on this emitter.
Next we will need to trigger this event handler by firing an event:
 onLogLevelChanged(event: ILogLevelChangedEvent) {
                emitter.fire(event)
            }

When calling this function, the emitter fires and all the event handlers
are called.
So if you need to trigger events in theia:

Create an emitter
Register events with the emitter.event function
Fire events with emitter.fire(event)

Commands_Keybindings.html.body:
Theia can be extended in a number of different ways. Commands allow packages to contribute unique commands that can then be called by other packages. It's also possible to add keybindings and contexts to these commands, so that they can only be called under certain conditions (window focus, current selection etc.).
Adding commands to Theia command registry
To contribute commands to the command registry, modules must implement the CommandContribution class, i.e 
java-commands.ts
@injectable()
export class JavaCommandContribution implements CommandContribution {
...
    registerCommands(commands: CommandRegistry): void {
        commands.registerCommand(SHOW_JAVA_REFERENCES, {
            execute: (uri: string, position: Position, locations: Location[]) =>
                commands.executeCommand(SHOW_REFERENCES.id, uri, position, locations)
        });
        commands.registerCommand(APPLY_WORKSPACE_EDIT, {
            execute: (changes: WorkspaceEdit) =>
                !!this.workspace.applyEdit && this.workspace.applyEdit(changes)
        });
    }
}

Each contribution needs a unique command id and a command handler (the callback that will be executed).
Binding the contribution to CommandContribution
The contributing class should then be injected into the appropriate module (make sure the class is tagged @injectable() first) like so
java-frontend-module.ts
export default new ContainerModule(bind => {
    bind(CommandContribution).to(JavaCommandContribution).inSingletonScope();
    ...
});

The class that is in charge of registering and executing the commands is the command registry. It is also possible to get the list of commands with the get commandIds() api.
Adding keybindings to the keybinding registry
Commands don't need keybindings by default, as they can be called by a lot of other means (programmatically, user clicks etc.). However, keybindings with specific contexts can be added to a command in a similar way to contributing commands.
To contribute a keybinding, simply inject an implementation of KeybindingContribution.
editor-keybinding.ts
@injectable()
export class EditorKeybindingContribution implements KeybindingContribution {

    constructor(
        @inject(EditorKeybindingContext) protected readonly editorKeybindingContext: EditorKeybindingContext
    ) { }

    registerKeybindings(registry: KeybindingRegistry): void {
        [
            {
                command: 'editor.close',
                context: this.editorKeybindingContext,
                keybinding: "alt+w"
            },
            {
                command: 'editor.close.all',
                context: this.editorKeybindingContext,
                keybinding: "alt+shift+w"
            }
        ].forEach(binding => {
            registry.registerKeybinding(binding);
        });
    }
}

The commandId must be a unique command that was registered beforehand, the context is a simple class that makes sure the command/keybinding combination is enabled for the certain conditions. In the case of the editor, it looks like this
editor-keybinding.ts
@injectable()
export class EditorKeybindingContext implements KeybindingContext {
    constructor( @inject(EditorManager) protected readonly editorService: EditorManager) { }

    id = 'editor.keybinding.context';

    isEnabled(arg?: Keybinding) {
        return this.editorService && !!this.editorService.activeEditor;
    }
}

The context also has a unique id, which can then be used to register several keybindings to commands within that context. The isEnabled() method is where the context is evaluated to true or false for given conditions. Note that the context is an optional parameter that, when not provided, defaults to the NOOP_CONTEXT. Keybindings registered using this context will always have an enabled context, thus making them work anywhere in the application.
With the id, the only other mandatory parameter is the keycode, which is basically a structure containing the actual keybindings. Here is the corresponding structure
keys.ts
export declare type Keystroke = { first: Key, modifiers?: Modifier[] };

Modifiers are platform independent, so Modifier.M1 is Command on OS X and CTRL on Windows/Linux. Key string constants are defined in keys.ts
Binding the contribution to KeybindingContribution
Just like you need to bind the command contributions, keybinding contributions also need to be bound per module like so
editor-frontend-module.ts
export default new ContainerModule(bind => {
    ...
    bind(CommandContribution).to(EditorCommandHandlers);
    bind(EditorKeybindingContext).toSelf().inSingletonScope();
    bind(KeybindingContext).toDynamicValue(context => context.container.get(EditorKeybindingContext));
    bind(KeybindingContribution).to(EditorKeybindingContribution);
});

Preferences.html.body:
Theia has a preference service which allows modules to get preference values, contribute default preferences and listen for preference changes.
Preferences can be saved in the root of the workspace under .theia/settings.json or under $HOME/.theia/settings.json on Linux systems. For Windows systems, the user settings will by default be in the %USERPROFILE%/.theia/settings.json (something like C:\Users\epatpol\.theia/settings.json)
As of right now the files must contain a valid a JSON containing the names and values of preferences (note that the following preference names are not official and only used as an example). You can also add comments to the settings.json file if needed i.e
{
    // Enable/Disable the line numbers in the monaco editor
    "monaco.lineNumbers": "off",
    // Tab width in the editor
    "monaco.tabWidth": 4,
    "fs.watcherExcludes": "path/to/file"
}
Let's take the filesystem as an example of a module using the preference service
Contributing default preferences as a module with inversify
To contribute some preference values. A module must contribute a valid json schema that will be used to validate the preferences. A module must bind the following PreferenceContribution to a value like this:
export interface PreferenceSchema {
    [name: string]: Object,
    properties: {
        [name: string]: object
    }
}

export interface PreferenceContribution {
    readonly schema: PreferenceSchema;
}

For instance, the filesystem binds it like so : 
export const filesystemPreferenceSchema: PreferenceSchema = {
    "type": "object",
    "properties": {
        "files.watcherExclude": {
            "description": "List of paths to exclude from the filesystem watcher",
            "additionalProperties": {
                "type": "boolean"
            }
        }
    }
};

bind(PreferenceContribution).toConstantValue(
{ 
    schema: filesystemPreferenceSchema 
});

Here are some useful links for contributing a validation schema:

JSON schema spec
Online JSON validator
Online JSON schema validator

Listening for a preference change via a configuration
To use the value of a preference, simply get the injected PreferenceService from the container
const preferences = ctx.container.get(PreferenceService);

In the case of the filesystem, the service is fetched at the beginning for the bindings. There, you can use the onPreferenceChanged method to register a pref changed callback.

constructor(@inject(PreferenceService) protected readonly prefService: PreferenceService
    prefService.onPreferenceChanged(e => { callback }

where the event received e is like this:
export interface PreferenceChangedEvent {
    readonly preferenceName: string;
    readonly newValue?: any;
    readonly oldValue?: any;
}

Although this can be used directly in the needed class, the filesystem provides a proxy preference service specific to the filesystem preferences (which uses the preference service in the background). This allows for faster and more efficient searching for the preference (as it searches for the preference in the filesystem preference service, and not on all preferences via the more generic preference service). It's also more efficient in the sense that only the modules watching for specific preferences related to a module will be notified. To do so, there is a proxy interface for the filesystem configuration that is bound like so using the preference proxy interface:
export type PreferenceProxy = Readonly & Disposable & PreferenceEventEmitter;
export function createPreferenceProxy(preferences: PreferenceService, configuration: T): PreferenceProxy {
    /* Register a client to the preference server
    When a preference is received, it is validated against the schema and then fired if valid, otherwise the default value is provided.

    This proxy is also in charge of calling the configured preference service when the proxy object is called i.e editorPrefs['preferenceName']

    It basically forwards methods to the real object, i.e dispose/ready etc.
}

To use that proxy, simply bind it to a new type X = PreferenceProxy and then bind(X) to a proxy using the method above.
export interface FileSystemConfiguration {
    'files.watcherExclude': { [globPattern: string]: boolean }
}

export const FileSystemPreferences = Symbol('FileSystemPreferences');
export type FileSystemPreferences = PreferenceProxy;

export function createFileSystemPreferences(preferences: PreferenceService): FileSystemPreferences {
    return createPreferenceProxy(preferences, defaultFileSystemConfiguration, filesystemPreferenceSchema);
}

export function bindFileSystemPreferences(bind: interfaces.Bind): void {

    bind(FileSystemPreferences).toDynamicValue(ctx => {
        const preferences = ctx.container.get(PreferenceService);
        return createFileSystemPreferences(preferences);
    });

    bind(PreferenceContribution).toConstantValue({ schema: filesystemPreferenceSchema });

}

Finally, to use the filesystem configuration in your module. Simply inject it where you need it. You can then access the preference like so (filesystem example) :
const patterns = this.preferences['files.watcherExclude'];

and you can also register for preference change like so:
this.toDispose.push(preferences.onPreferenceChanged(e => {
    if (e.preferenceName === 'files.watcherExclude') {
        this.toRestartAll.dispose();
    }
}));

